    private int getLastIndex(char c, int[] array){
        int p = hash(c);
        if (array[p] > 0){
            return array[p];
        }else{
            return 0;
        }
    }

    public int lengthOfLongestSubstring(String s) {
        int result = 0;
//        Map<Integer, Integer> lastTimeAppend = new HashMap<Integer, Integer>();
        int lastTimeAppend[] = new int[256];
        int start = 1;
        char chars[] = s.toCharArray();
        for (int i = 1; i <= chars.length; ++i){
            int  tmp = getLastIndex(s.charAt(i - 1), lastTimeAppend);
            if (tmp > 0){
                start = start > tmp + 1? start : tmp + 1;
            }
            lastTimeAppend[hash(s.charAt(i - 1))] = i;
            //lastTimeAppend.put(hash(s.charAt(i - 1)), i);
            result = result > i - start + 1 ? result : i - start + 1;
        }
        return result;
    }

